import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom'
import Home from './components/Home';
import Header from './components/Header';

function App() {
  return (
    <BrowserRouter>
    <div>
    <Routes>
    <Header />
      <Route exact path="/" element={ <Home/> } />

      </Routes>
      </div>
    </BrowserRouter>

  );
}

export default App;
